import React from 'react'

export default function Hub(props) {
    const {cars, onAdd } = props;
    return (
        <div>cars.map((cars) =>(
            <Cars key={cars.id} cars={cars} onAdd={onAdd}></Cars>
            ))</div>
  )
}
